import logging
from datetime import datetime
from enum import Enum
from typing import List, Dict, Optional
import sqlite3
import csv
import json
from threading import Lock

# Database setup
DB_FILE = "fabs_submissions.db"

class SubmissionStatus(Enum):
    RECEIVED = "Received"
    VALIDATING = "Validating"
    VALIDATED = "Validated"
    PROCESSING = "Processing"
    PUBLISHED = "Published"
    ERROR = "Error"

class GtasWindowStatus(Enum):
    OPEN = "Open"
    LOCKED = "Locked"

class SubmissionManager:
    def __init__(self):
        self.conn = sqlite3.connect(DB_FILE)
        self.lock = Lock()
        self._init_db()
        self.logger = logging.getLogger("SubmissionManager")
        logging.basicConfig(level=logging.INFO)

    def _init_db(self):
        with self.conn:
            self.conn.execute("""
                CREATE TABLE IF NOT EXISTS submissions (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    submission_id TEXT UNIQUE,
                    status TEXT,
                    last_updated TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                    published BOOLEAN DEFAULT FALSE
                )
            """)
            self.conn.execute("""
                CREATE TABLE IF NOT EXISTS status_log (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    submission_id TEXT,
                    old_status TEXT,
                    new_status TEXT,
                    changed_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
                )
            """)
            self.conn.execute("""
                CREATE TABLE IF NOT EXISTS validation_rules (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    rule_name TEXT,
                    rule_logic TEXT,
                    active BOOLEAN DEFAULT TRUE,
                    updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
                )
            """)

    def log_status_change(self, submission_id: str, old_status: str, new_status: str):
        with self.conn:
            self.conn.execute(
                "INSERT INTO status_log (submission_id, old_status, new_status) VALUES (?, ?, ?)",
                (submission_id, old_status, new_status)
            )
        self.logger.info(f"Status changed for {submission_id}: {old_status} -> {new_status}")

    def update_submission_status(self, submission_id: str, new_status: str):
        with self.lock, self.conn:
            cursor = self.conn.cursor()
            cursor.execute("SELECT status FROM submissions WHERE submission_id = ?", (submission_id,))
            result = cursor.fetchone()

            if not result:
                raise ValueError(f"Submission {submission_id} not found")

            old_status = result[0]
            if old_status == new_status:
                return

            if new_status == SubmissionStatus.PUBLISHED.value:
                cursor.execute("SELECT published FROM submissions WHERE submission_id = ?", (submission_id,))
                if cursor.fetchone()[0]:
                    raise ValueError("Submission already published - cannot publish again")

                cursor.execute(
                    "UPDATE submissions SET status = ?, published = TRUE WHERE submission_id = ?",
                    (new_status, submission_id)
                )
            else:
                cursor.execute(
                    "UPDATE submissions SET status = ? WHERE submission_id = ?",
                    (new_status, submission_id)
                )

            self.log_status_change(submission_id, old_status, new_status)

    def check_gtas_window_status(self) -> GtasWindowStatus:
        current_hour = datetime.now().hour
        # Example: GTAS is locked from 8 PM to 4 AM
        if 20 <= current_hour or current_hour < 4:
            return GtasWindowStatus.LOCKED
        return GtasWindowStatus.OPEN

    def update_validation_rule(self, rule_name: str, rule_logic: str, active: bool = True):
        with self.conn:
            self.conn.execute(
                """INSERT OR REPLACE INTO validation_rules (rule_name, rule_logic, active) 
                   VALUES (?, ?, ?)""",
                (rule_name, rule_logic, active)
            )
        self.logger.info(f"Updated validation rule: {rule_name}")

    def process_historical_deletions(self, older_than_days: int = 365):
        cutoff_date = datetime.now() - datetime.timedelta(days=older_than_days)
        with self.conn:
            self.conn.execute(
                "DELETE FROM submissions WHERE last_updated < ? AND status = ?",
                (cutoff_date, SubmissionStatus.PUBLISHED.value)
            )
        self.logger.info(f"Processed historical deletions older than {older_than_days} days")

    def generate_d_files(self, source_systems: List[str], output_path: str) -> bool:
        try:
            with open(output_path, 'w', newline='') as csvfile:
                writer = csv.writer(csvfile)
                writer.writerow(['System', 'RecordCount', 'GeneratedAt'])

                for system in source_systems:
                    record_count = len(self._get_sample_data(system))
                    writer.writerow([system, record_count, datetime.now().isoformat()])
            return True
        except Exception as e:
            self.logger.error(f"Failed to generate D files: {e}")
            return False

    def _get_sample_data(self, system: str) -> List[Dict]:
        # Mock data generation for demonstration
        if system == "FPDS":
            return [{"id": i, "value": f"fpds_{i}"} for i in range(100)]
        elif system == "FABS":
            return [{"id": i, "value": f"fabs_{i}"} for i in range(150)]
        return []

    def validate_flex_fields(self, submission_id: str, field_rules: Dict) -> Dict[str, List[str]]:
        validation_errors = {}
        for field, rules in field_rules.items():
            field_errors = []
            if "required" in rules and rules["required"]:
                if not self._field_has_value(submission_id, field):
                    field_errors.append("Field is required")
            if "max_length" in rules:
                value = self._get_field_value(submission_id, field)
                if value and len(value) > rules["max_length"]:
                    field_errors.append(f"Exceeds max length of {rules['max_length']}")
            if field_errors:
                validation_errors[field] = field_errors
        return validation_errors

    def _field_has_value(self, submission_id: str, field: str) -> bool:
        # Mock implementation
        return bool(field)  # Simplified for example

    def _get_field_value(self, submission_id: str, field: str) -> Optional[str]:
        # Mock implementation
        return "sample_value" if field else None

    def derive_funding_agency_code(self, ppo_code: str) -> str:
        # Simple derivation logic
        if ppo_code.startswith("X"):
            return "AGENCY_X"
        elif ppo_code.startswith("Y"):
            return "AGENCY_Y"
        return "DEFAULT_AGENCY"

    def generate_user_testing_report(self, test_scenarios: List[Dict], output_format: str = "json") -> str:
        report_data = {
            "date": datetime.now().isoformat(),
            "scenarios_tested": len(test_scenarios),
            "pass_count": sum(1 for s in test_scenarios if s.get("passed", False)),
            "fail_count": sum(1 for s in test_scenarios if not s.get("passed", True)),
            "scenarios": test_scenarios
        }

        if output_format == "json":
            return json.dumps(report_data, indent=2)
        elif output_format == "csv":
            output = ["Scenario,Passed,Comments"]
            for scenario in test_scenarios:
                output.append(f"{scenario['name']},{scenario.get('passed', False)},{scenario.get('comments', '')}")
            return "\n".join(output)
        return str(report_data)

    def validate_loan_records(self, records: List[Dict]) -> Dict[str, List[Dict]]:
        valid_records = []
        invalid_records = []

        for record in records:
            amount = record.get("amount")
            if amount is None or amount == "" or amount == 0:
                invalid_records.append({
                    "record": record,
                    "error": "Amount cannot be zero or blank"
                })
            else:
                valid_records.append(record)

        return {
            "valid": valid_records,
            "invalid": invalid_records,
            "invalid_count": len(invalid_records)
        }

    def update_fabs_sample_file(self, schema: Dict, output_path: str) -> bool:
        try:
            with open(output_path, 'w') as f:
                json.dump(schema, f, indent=2)
            return True
        except Exception as e:
            self.logger.error(f"Failed to update FABS sample file: {e}")
            return False

    def check_fpds_updated(self, last_checked: datetime) -> bool:
        # Mock implementation - would check actual DB in production
        return (datetime.now() - last_checked).total_seconds() > 3600  # Assume updated if >1hr

    def sync_d1_generation(self):
        if self.check_fpds_updated(datetime.now() - datetime.timedelta(hours=1)):
            self.generate_d_files(["FPDS", "FABS"], "D1_report.csv")

class ResourcesPage:
    def __init__(self):
        self.design_system = {
            "colors": {"primary": "#005ea2", "secondary": "#dfe1e2"},
            "typography": {"font": "Source Sans Pro", "base_size": "16px"},
            "spacing": {"unit": "8px"}
        }

    def apply_design_system(self, current_page: Dict) -> Dict:
        updated_page = current_page.copy()
        updated_page["styles"] = self.design_system
        updated_page["last_updated"] = datetime.now().isoformat()
        return updated_page

class TestingScheduler:
    def schedule_testing(self, participants: List[str], test_date: datetime, lead_time_days: int = 7) -> Dict:
        if (test_date - datetime.now()).days < lead_time_days:
            raise ValueError(f"Need at least {lead_time_days} days lead time for scheduling")

        return {
            "scheduled_date": test_date.isoformat(),
            "participants": participants,
            "confirmation_sent": False,
            "reminders": []
        }
